@Composable
fun SampleLineGraph(lines: List<List<DataPoint>>) {
    LineGraph(
        plot = LinePlot(
            listOf(
                LinePlot.Line(
                    lines[0],
                    LinePlot.Connection(color = Color.Red),
                    LinePlot.Intersection(
                        color = Color.Green,
                        radius = 4.dp),
                    LinePlot.Highlight(
                        color = Color.Red,
                        radius = 6.dp
                        ),
                )
            ),
            grid = LinePlot.Grid(Color.Red, steps = 4),
            xAxis = LinePlot.XAxis()
        ),
        modifier = Modifier
            .fillMaxWidth()
            .height(200.dp),
        onSelection = { xLine, points ->
            Log.d("xLine", xLine.toString())
            Log.d("points", points.toString())
        },
        onSelectionStart = {
            Log.d("Selection", "Start")
        },
        onSelectionEnd = {
            Log.d("Selection", "End")
        }
    )
}